css:
@-moz-document url-prefix("https://disk.yandex") {
.PSHeader, .header, .resources-action-bar, .footer, .journal-filter {
    background: url('data:image/png;base64,') no-repeat !important;
    background-size: 100% !important;
}
* {
    background-color: transparent !important;           
	color: #aaa !important;
    border-color: #006BB2 !important;
}
a:link, a:visited, a:active, .b-access__title, .b-invite-form__fields .nb-button, .b-invite-form__fields .nb-input, .versions-dialog__modal, .dialog__wrap, .calendar, .upload-listing .listing__items .listing-item__title, h3, .journal-group-item__name, .search-input__form-input .Textinput-Control, .suggest-item__text, .PSHeaderService-Text, .listing-sort__menu.Menu, .Menu, .Textinput-Control, .ShareDialogAccessType-Title, .ListTile-Wrapper_rightSpace_xl {
	color: #0099ff !important;
}
a:hover {
    color: #00ffff;
	animation: yadix 1s ease-in-out
}
@keyframes yadix {
	0% {box-shadow: 5px 5px 50px 10px #00beff; border-radius:50px 0px 50px 0; color: #075981;}
}
@Keyframes look {
	0% {
	transform: rotate(5deg) scale(0);
	opacity: 0; }
    50% {
	transform: rotate(-5deg) scale(1);
    opacity: 1; }    
	100% {
	transform: rotate(0deg); }
}
.Popup2_view_default, .light-popup_visible_yes {
    -webkit-animation-name: look; 
    -webkit-animation-duration: 1s
}
::-webkit-scrollbar {
    background: -webkit-linear-gradient(40deg , #000000 , #002D45 , #000000 100%)!important;
    width: 5px !important;
}
::-webkit-scrollbar-thumb {
    background: -webkit-linear-gradient(10deg , #000000 , #0099ff , #000000 100%)!important;
    border-radius: 100px!important;
    border: 0px!important;
}
::-webkit-scrollbar-thumb:hover, .journal-group-item_stub, .photo_selecting .with-checkbox-selectable-item__checkbox {
    cursor: pointer !important;
    background: -webkit-linear-gradient(10deg , #075981 , #0099ff , #075981 100%)!important;
    border: 1px solid #0099ff !important;
}
.LeftColumn:not(:hover) {
    transition: 2s !important;
    transform: translate(-100%);
    opacity: 0.3;
}
.root__content-container {
    margin-left: -150px;
    transition: 1s !important;
}
.listing-item:not(:hover) {
    transform: perspective(500px) rotateY(-20deg) rotateX(20deg);
    transition: 1s transform ease-in-out 
}
.listing-item { 
      transform: perspective(2000px) rotateY(0deg) rotateX(0deg);
      transition: 0.1s all ease-in-out;	
}
svg [fill="#000"], svg [fill="currentColor"] {
    fill:#0099ff;
}
